// Parse the input arguments into an object
function parceArguments(argv) {
    var r = {};
    for (var i in argv) {
        i = parseInt(i);
        if (argv[i].startsWith('--') == true) {
            var key = argv[i].substring(2).toLowerCase(), val = true;
            if (((i + 1) < argv.length) && (argv[i + 1].startsWith('--') == false)) { val = argv[i + 1]; }
            r[key] = val;
        }
    }
    return r;
}

